//variable to store a node valie
def orderId = holder.getNodeValue("//*:orderId")

log.info "$orderId"

context.testCase.testSuite.setPropertyValue("OrderId",orderId)

context.testCase.testSuite.project.setPropertyValue("OrderId",orderId)
